import "./post.css"

export default function post() {
    return (
        <div className="post">
            <img src="https://images.pexels.com/photos/1591056/pexels-photo-1591056.jpeg?auto=compress&cs=tinysrgb&h=750&w=1260" alt="blog" />
        </div>
    )
}
